"<div>\n<i class=\"NoteType\">\nTranscription\n</i>\n<div class=\"grampsstylednote\">\n<p>\nB 82<br />\nMarie Philom\u00e8ne Charland (de St Leon)\n</p>\n<p>\nLe cinq juin mil huitcent trente sept, nous Pretre Vicaire sousign\u00e9 avons baptis\u00e9 Marie Philom\u00e8ne n\u00e9e ce jour du l\u00e9gitime marriage de Dvid Charland, meunier, cultivateur, et de Julie Sicard dite Carufel de la paroisse Saint L\u00e9on. Parrain Fran\u00e7ois *Julien*, marraine Josephte Gravelle qui ont, *ainsi que le p\u00e8red\u00e9clar\u00e9 ne savoir signer. P. Gari\u00e9py, Ptr v.\n</p>\n</div>\n</div>",
