"<div>\n<i class=\"NoteType\">\nTranscription\n</i>\n<div class=\"grampsstylednote\">\n<p>\nB46 Lalonde Anna mari\u00e9e le 22 juin 1908 \u00e0 Georges-Henri Tremblay \u00e0 Lemieux, Ont. bapt. \u00e0 Redford N.Y. 22 juin 1880<br />\nLe dix juin mil huit cent quatre-vinght huit, nous cur\u00e9 sousign\u00e9 avons baptis\u00e9 Anna n\u00e9e le quatre courant du l\u00e9gitime ________ de Ferdinand Lalonde cultivateur et de Ad\u00e8le Leroux, de cette paroisse. Le parrain a \u00e9t\u00e9 Francis Mc Allerty, la marraine ___________ _____________ qui n'ont pu sign\u00e9. Lecture faite.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nTranscription\n</i>\n<div class=\"grampsstylednote\">\n<p>\nM5 George Henri Tremblay et Anna Lalonde\n</p>\n<p>\nLe vingt deux juin mil neuf cent huit, apr\u00e8s la publication d'un ban de mariage dispense des deux autres ayant \u00e9t\u00e9 accord\u00e9e par nous soussign\u00e9, en vertu d'un pouvoir re\u00e7u de sa grandeur ________ Joseph Thomas Duhamel archev\u00eaque d'Ottawa; entre George Henri Tremblay agent fils majeur de feu Louis Tremblay et de Philom\u00e8ne Charland de Ste-Marie de Tupper Lake N. Y. d'une part, et Anna Lalonde fille majeure de Ferdinand Lalonde cultivateur et de Ad\u00e8le Leroux de cette paroisse d'autre part, ne s'\u00e9tant d\u00e9clar\u00e9 aucun emp\u00eachement de mariage, nous soussign\u00e9 cur\u00e9 de cette paroisse avons re\u00e7u leur mutuel consentement de mariage et leur avons donn\u00e9 la b\u00e9n\u00e9diction nuptiale en pr\u00e9sence de Edouard Lalonde et Alice Duquette, qui ainsi que les parties contractantes ont sign\u00e9 avec nous. lecture faites\n</p>\n<p>\nGeorge H. Tremblay<br />\nAnna Lalonde<br />\nEd Lalonde<br />\nAlice Duquette\n</p>\n<p>\nJ.A. Laflamme Ptre\n</p>\n</div>\n</div>",
