"<div>\n<i class=\"NoteType\">\nTranscription\n</i>\n<div class=\"grampsstylednote\">\n<p>\nB191 J. Louis Ferdinand Tremblay<br />\nLe sept ao\u00fbt mil neuf cent dix, nous, pr\u00eatre sousign\u00e9 avons baptis\u00e9s Joseph Louis Ferdinand n\u00e9 le trois courant, fils l\u00e9gitime de Georges Tremblay qui a sign\u00e9 et de Anna Laonde de cette paroisse. Le parrain a \u00e9t\u00e9 Louis Tremblay oncle de l'enfant du Sacr\u00e9-Coeur de Montr\u00e9al qui a sign\u00e9, et la marraine Albina L'Esp\u00e9rance qui a sign\u00e9. Lecture faite.<br />\nAlbina L'Esperance<br />\nLouis Tremblay<br />\nGeorge H. Tremblay<br />\nJ. _____ Filteau Ptre\n</p>\n</div>\n</div>",
