"<div>\n<i class=\"NoteType\">\nTranscription\n</i>\n<div class=\"grampsstylednote\">\n<p>\nle dix sept f\u00e9vrier mil huit cent vingt trois nous Cur\u00e9 <em>deservant</em> soussign\u00e9 avons inhum\u00e9 dans le cimeti\u00e8re de cette paroisse le corps d'Andr\u00e9 Tremblay mort depuis un mois et douze jours, ag\u00e9 d'environ soixante et dix ans, \u00e9poux de d\u00e9funte Marie Louise Savard. T\u00e9mois Fran\u00e7ois leclerc et Zacharie Leclerc qui ont sign\u00e9 avec nous.\n</p>\n</div>\n</div>",
